import './App.css';

var name = "Samson";
var toggle = true;

var App = () => {
  return (
    <div className="App">
      <h1>Hello, {name}!</h1>
      <br/>
      {button()}
    </div>
  );
}

const button = () => {
  return (
    <button onClick={onClick}>
      Switch User
    </button>
  )
}

function onClick() {
  if (toggle) {
    name = "Jack";
    toggle = false;
  } else {
    name = "Jakob";
    toggle = true;
  }
}

export default App;
